import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { useAuth } from './context/AuthContext';
import Layout from './components/Layout';
import Login from './pages/Login';

// صفحات المدير
import AdminDashboard from './pages/admin/Dashboard';
import UsersManagement from './pages/admin/UsersManagement';
import BranchesManagement from './pages/admin/BranchesManagement';
import GamesManagement from './pages/admin/GamesManagement';
import RentalsManagement from './pages/admin/RentalsManagement';
import ActivitiesLog from './pages/admin/ActivitiesLog';
import Settings from './pages/admin/Settings';
import ReportsPage from './pages/admin/ReportsPage';

// صفحات الموظف
import EmployeeDashboard from './pages/employee/Dashboard';
import EmployeeGames from './pages/employee/Games';
import EmployeeRentals from './pages/employee/Rentals';
import SeparatedGames from './pages/employee/SeparatedGames';

const PrivateRoute = ({ children, requiredRole = null }) => {
  const { isAuthenticated, user } = useAuth();
  
  if (!isAuthenticated) {
    return <Navigate to="/login" />;
  }
  
  if (requiredRole && user?.role !== requiredRole) {
    return <Navigate to="/" />;
  }
  
  return children;
};

const AppRoutes = () => {
  return (
    <Routes>
      {/* الصفحة الرئيسية - تسجيل الدخول */}
      <Route path="/login" element={<Login />} />
      
      {/* Routes للمدير */}
      <Route path="/admin/*" element={
        <PrivateRoute requiredRole="admin">
          <Layout>
            <Routes>
              <Route path="/" element={<AdminDashboard />} />
              <Route path="/users" element={<UsersManagement />} />
              <Route path="/branches" element={<BranchesManagement />} />
              <Route path="/games" element={<GamesManagement />} />
              <Route path="/rentals" element={<RentalsManagement />} />
              <Route path="/activities" element={<ActivitiesLog />} />
              <Route path="/reports" element={<ReportsPage />} />
              <Route path="/settings" element={<Settings />} />
            </Routes>
          </Layout>
        </PrivateRoute>
      } />
      
      {/* Routes للموظف */}
      <Route path="/employee/*" element={
        <PrivateRoute requiredRole={['employee', 'branch_manager']}>
          <Layout>
            <Routes>
              <Route path="/" element={<EmployeeDashboard />} />
              <Route path="/games" element={<EmployeeGames />} />
              <Route path="/games" element={<EmployeeGames />} />
              <Route path="/rentals" element={<EmployeeRentals />} />
            </Routes>
          </Layout>
        </PrivateRoute>
      } />
      
      {/* Route افتراضي - إعادة التوجيه */}
      <Route path="/" element={
        <PrivateRoute>
          <Navigate to="/admin" />
        </PrivateRoute>
      } />
      
      {/* Route لصفحة غير موجودة */}
      <Route path="*" element={
        <div style={{ padding: '20px', textAlign: 'center' }}>
          <h1>404 - الصفحة غير موجودة</h1>
          <p>الصفحة التي تبحث عنها غير موجودة.</p>
        </div>
      } />
    </Routes>
  );
};

export default AppRoutes;
